import React from 'react';

export default () => {
  return (
    <table>
      <tbody>
        <tr>
          <td className={'green'}>xxx</td><td className={'white'}>{'- checked by mentor  '}</td>
          <td className={'yellow'}>xxx</td><td className={'white'}>{'- students working on tdat task now  '}</td>
          <td className={'gray'}>xxx</td><td className={'white'}>{'- task in todo state  '}</td>
          <td className={'pink'}>xxx</td><td className={'white'}>{'- need to check  '}</td>
          <td className={'red'}>xxx</td><td className={'white'}>{'- checked by mentime for checking is gone and no mark from mentor  '}</td>
        </tr>
      </tbody>
    </table>
  );
};
